import{d as e}from"./app.a5d70427.js";const a={},t=e('<h1 id="streaming-history-sync"><a class="header-anchor" href="#streaming-history-sync">#</a> Streaming history sync</h1><p>After importing your data (which you can read more about <a href="/import">here</a>) you of course want your data to be kept up to date, and that&#39;s what this feature is for</p><h2 id="how-does-it-work"><a class="header-anchor" href="#how-does-it-work">#</a> How does it work?</h2><p>About every 100 minutes your 50 recently played tracks are fetched from Spotify and saved in the same database where your imported streams are. By doing this 24/7 the database - and thus the data in the app - will be kept up to date ðŸ˜ƒ</p><p>This feature is disabled by default and after importing your data this feature is automatically enabled so your data will be kept up to date.</p><h2 id="should-i-enable-this-manually"><a class="header-anchor" href="#should-i-enable-this-manually">#</a> Should I enable this manually?</h2><p>There is an option to enable the sync manually in the app. When you request your data it&#39;ll take about 2 weeks before it arrives and it will contain data from the birth of your Spotify account till about 2 days before you&#39;ve received the files. For example: if you&#39;ve requested the data on June 1st and you&#39;ve received the data on June 14th, the data will include streams untill ~June 12th. Since this sync is started on the moment you import your data, there will probably be a gap of about 2 days. If you&#39;re concerned about this gap you can manually turn on the sync after you&#39;ve requested your data.</p><h3 id="i-don-t-want-to-import-my-data-but-i-do-want-this-feature"><a class="header-anchor" href="#i-don-t-want-to-import-my-data-but-i-do-want-this-feature">#</a> I don&#39;t want to import my data but I do want this feature</h3><p>Of course you can enable this feature without importing your data, but please note that you wont be able to view (accurate) lifetime data.</p><h2 id="can-there-be-any-duplicates-between-my-imported-data-and-the-synced-data"><a class="header-anchor" href="#can-there-be-any-duplicates-between-my-imported-data-and-the-synced-data">#</a> Can there be any duplicates between my imported data and the synced data?</h2><p>No ðŸ˜ƒ</p>',11);a.render=function(e,a){return t};export default a;
